Aqui lo que tenemos es una profecional por cierto. Esta buena, esta rica, esta preparada para todo incluyendo POR EL CHIQUITO! Cuando me dijo lo que queria hacer enfrente de mi camara yo llame a mi amigo y le dije que tenia una tipa preparada para el. El vio las fotos y quedo asombrado y imediatamente queria conocerla. Ella se estaba demorando un poco probandose y midiendose una ropa bien sexy. Despues de que yo la observe y toque en lugares inapropiados la lleve a mi amigo. El estaba tan contento le metio el pene en la boca mojandolo un poco para despues meterselo en el culo rico que tiene ella!
